import React from "react";

import { BrowserRouter, Routes, Route } from "react-router-dom";

import LandingPage from "./src/Landingpage";

const Application = () => {
  return(
    <div>
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<LandingPage></LandingPage>}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  )
}

export default Application;
